#include <iostream>
#include <string>

std::string convertMarkdownToHtml(std::string &markdownText) {
    std::string htmlText;

    // Handle line breaks
    for (char c : markdownText) {
        if (c == '\n') {
            htmlText.push_back('<br>');
        }
    }

    // Handle headers (assuming Markdown syntax: # Title for h1, ## Title for h2, and so on)
    size_t headerLevel = 1;
    while ((headerLevel * 4 + 1) < markdownText.length()) {
        size_t headerEnd = markdownText.find('#', headerLevel * 4);
        if (headerEnd != std::string::npos) {
            std::string headerText = markdownText.substr(headerLevel * 4, headerEnd - headerLevel * 4);
            htmlText += "&lt;h" + std::to_string(headerLevel) + "&gt;";
            for (char c : headerText) {
                if (c == '#' || c == ' ') {
                    headerText.erase(headerText.begin() + c - ' ');
                } else {
                    htmlText.push_back(c);
                }
            }
            htmlText += "&lt;/h" + std::to_string(headerLevel) + "&gt;<br>";
            headerLevel++;
        }
    }

    // More conversions can be added here for other Markdown features (blockquotes, emphasis, code blocks, etc.)

    return htmlText;
}

int main() {
    std::string markdownText = "# Hello World\nThis is an example of a header.\n\n*This is italic text.*\n\n**This is bold text.**\n\n> This is a blockquote.\n\n```\nThis is a code block.\n```";
    std::string htmlText = convertMarkdownToHtml(markdownText);
    std::cout << "Markdown Text:\n" << markdownText << std::endl;
    std::cout << "Converted HTML Text:\n" << htmlText << std::endl;
    return 0;
}

