In the Godot Engine, the first-person controller scripting can be achieved by attaching the script to a Node2D and using the `KinematicBody2D` node or its equivalent within any version of the engine.

Here's an example of how you might have a simple first-person controller script in Godot Engine 3.x:

```gdscript
extends KinematicBody2D

var speed = 200
var turning_speed = 225

# Define variables for movement
var target = Vector2(0, 0)
var rotation = 0
var facing_left = false

func _physics_process(delta):
    # Calculate movement toward the target
    move_and_slide(get_desired_velocity(speed, target, facing_left))

    # Detect input from the keyboard
    input_action_setup.set_action(InputAction.pan(), "move")
    handle_input("move")

    # Check for mouse look input
    if Input.is_action_just_released("look"):
        if facing_left:
            target = global_transform.origin.x - 200
            facing_left = false
        else:
            target = global_transform.origin.x + 200
            facing_left = true

func _input(event):
    if event is InputEventKey and event.pressed:
        if event.scancode == KEY_W:
            target = global_transform.origin + Vector2(0, 0).rotated(rotation)
        elif event.scancode == KEY_S:
            target = global_transform.origin - Vector2(0, 0).rotated(rotation)
        elif event.scancode == KEY_WARDRIGHT:
            target = global_transform.origin - Vector2(0, 0).rotated(rotation + (np.pi/2))
        elif event.scancode == KEY_WLEFT:
            target = global_transform.origin + Vector2(0, 0).rotated(rotation + (np.pi/2))
    else:
        handle_input("look")

func handle_input(action):
    if Input.is_action_pressed(action):
        var desired_velocity = Vector2(speed, 0).rotated(rotation)

        if Input.is_action_just_released("look"):
            desired_velocity.y = 0

        if Input.is_action_pressed("move"):
            facing_left = not facing_left
            desired_velocity *= (1 if facing_left else -1)

        set_average_speed(desired_velocity)

func set_average_speed(velocity):
    var acceleration = velocity / delta
    global_velocity += acceleration

func get_desired_velocity(speed, target, facing_left):
    var direction = Vector2(
        (target.x - global_position.x) * (facing_left ? -1 : 1),
        -(target.y - global_position.y)
    ).normalized

    return direction * speed
